import React, { useState } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';

const TokenInfo = () => {
  const [tokenInfo, setTokenInfo] = useState(null);

  const getTokenInfo = async () => {
    try {
      const response = await fetch('http://220.88.39.23:5000/api/user/token?username=test&team=울산');
      const data = await response.json();
      setTokenInfo(data);
      console.log('Token信息:', data); // 在控制台也打印一份
    } catch (error) {
      console.error('获取失败:', error);
    }
  };

  return (
    <Card className="w-full max-w-2xl mx-auto mt-8">
      <CardHeader>
        <CardTitle>Token信息</CardTitle>
      </CardHeader>
      <CardContent>
        <Button onClick={getTokenInfo} className="mb-4">
          获取Token信息
        </Button>

        {tokenInfo && (
          <div className="space-y-4">
            <div className="bg-gray-50 p-4 rounded-lg">
              <h3 className="font-bold mb-2">完整响应数据:</h3>
              <pre className="whitespace-pre-wrap break-all text-sm">
                {JSON.stringify(tokenInfo, null, 2)}
              </pre>
            </div>

            <div className="space-y-2">
              <h3 className="font-bold">分项信息:</h3>
              {Object.entries(tokenInfo).map(([key, value]) => (
                <div key={key} className="bg-gray-50 p-3 rounded">
                  <span className="font-medium">{key}: </span>
                  <span className="break-all">{value}</span>
                </div>
              ))}
            </div>
          </div>
        )}
      </CardContent>
    </Card>
  );
};

export default TokenInfo;
